今回のアプリケーションは twitter ライクな SNS なので「tweets」テーブルを作成する． Laravel では「マイグレーション」という仕組みを使用してテーブルの管理を行う．また，テーブル内のデータは「Model」を使用して操作する．Laravel ではEroquent Modelと呼ばれる ORM を使用する． 【解説 / マイグレーション】 マイグレーションとは「マイグレーションファイル」を用いてテーブルを管理する仕組み． 「マイグレーションファイル」にテーブル名やカラム名を記述し，指定されたコマンドを実行することで設定したテーブルが生成される． 【解説 / Eloquent Model】 Eloquent Model は Laravel 標準の ORM（object-relational mapper）である． ORM とは，DB のレコードをオブジェクトとして直感的に扱えるようにしたもので，SQL を意識せずにプログラムで処理を記述することができる． Eloquent Model は定義された「Model」を用いることで簡単に DB へのデータ保存・取得などを行える． 1 つのモデルが 1 つのテーブルに対応する．例えば，tweetsテーブルに対してTweetのようにモデルを定義すると自動的に対応する．モデル内に明示的に対応を記述することもできる． テーブルに対してデータ操作を行う場合，対応するモデルに対して処理を実行することで DB 操作を行うことができる． Model とマイグレーションファイルは一度に両方とも作成することができる． 下記コマンドは Model を作成するコマンドだが（Tweetがモデル名），-mをつけることでマイグレーションファイルも同時に作成できる．この手法を用いることで，Model 名とマイグレーションファイル内のテーブル名が自動的に対応する． 早速実行． $ php artisan make:model Tweet -m # 実行結果（日付時刻は毎回変わる）
Model created successfully.
Created Migration: 2021_09_23_130915_create_tweets_table database/migration/2021_09_23_130915_create_tweets_table.phpを開く．これがマイグレーションファイルである． カラムを追加するため，下記にように編集する．今回はtweet，descriptionの 2 カラムを追加する． カラムを追加するときはデータ型も設定する．tweetは文字列（string），descriptionはテキスト（text）を設定している． idははじめから用意されているので設定不要． 【tips】 nullable()を記述することで，入力必須でなくすることができる．他にunique()で重複を禁止することもできる． timestamps()はcreated_atカラムとupdated_atカラムを自動的に設定してくれる． // database/migrations/2021_09_23_130915_create_tweets_table.php <?php use Illuminate\Database\Migrations\Migration;
use Illuminate\Database\Schema\Blueprint;
use Illuminate\Support\Facades\Schema; class CreateTweetsTable extends Migration
{ /** * Run the migrations. * * @return void */ public function up() { Schema::create('tweets', function (Blueprint $table) { $table->id(); // 🔽 ここから追加 $table->string('tweet'); $table->text('description')->nullable(); // 🔼 ここまで追加 $table->timestamps(); }); } /** * Reverse the migrations. * * @return void */ public function down() { Schema::dropIfExists('tweets'); }
}

